import React from "react";
import { View , Image , StyleSheet, Text } from "react-native";
import Logo from '../assets/Aadhar-Color.png';

import { Divider , Button , Input } from "native-base";


export default function RegistrationScreen() {
    return(
        <View style={styles.container}>
            <View style={styles.logoContainer}>
                <Image source={Logo} style={styles.logo}/>
            </View>
            <View style={{ marginLeft: 20 , marginRight: 20 }}>
                <Divider orientation="horizontal" mx="auto" bg="coolGray.400" thickness="1"/>
            </View>
            <View style={styles.formContainer}>
                <Input variant="filled" placeholder="Enter 12 Digit Aadhar Number" keyboardType="number-pad" />
                <Button isLoading isLoadingText="Submitting">
                    Button
                </Button>
            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'column',
    },
    logoContainer: {
        flex: 1,
        justifyContent: 'center'
    },
    formContainer: {
        flex: 3, 
        marginRight:20,
        marginLeft:20,
        padding: 20,
    },
    logo : {
        width: 190,
        height: 120,
        alignSelf:'center',
    }
})
